import React from "react";
import { InlineMath } from "react-katex";

function Home(props) {
  return (
    <div className="subcontainer">
      <div className="row">
        <h3>
          <u>The Basics</u>
        </h3>
      </div>
      <div className="row">
        <div className="col-sm-6">
          <p>
            <InlineMath math="\LaTeX" />
            &thinsp; is a typesetting system used in many technical academic
            fields. The system takes your input and formats it to display
            equations, graphics and document layouts.
          </p>
          <p>
            With the{" "}
            <a
              href="http://texdoc.net/texmf-dist/doc/latex/amsmath/amsldoc.pdf"
              style={{ color: "black" }}
            >
              <b>amsmath</b>
            </a>{" "}
            package, &thinsp;
            <InlineMath math="\LaTeX" />
            &thinsp; allows users to type up mathematics for a professional
            presentation.
          </p>
        </div>
        <div className="col-sm-6"></div>
      </div>
    </div>
  );
}

export default Home;
